var t=[{docs:"\n      ## Editors\n\n      Many popular code tools have syntax highlighting support for Emblem.  Emblem is also fairly similar to Jade or Slim, and it is possible that syntax highlighting for those may be useful.\n    "},{title:"VS-Code",instructions:"Follow the instructions at [https://marketplace.visualstudio.com/items?itemName=tmosmant.vscode-emblem](https://marketplace.visualstudio.com/items?itemName=tmosmant.vscode-emblem"},{title:"Atom",instructions:"Follow the instructions at [https://atom.io/packages/atom-emblem](https://atom.io/packages/atom-emblem)"},{title:"Sublime Text 2/3",instructions:"Follow the instructions at [https://github.com/johanobergman/sublime-emblem-syntax](https://github.com/johanobergman/sublime-emblem-syntax)"},{title:"vim-emblem",instructions:"Follow the instructions at [https://github.com/heartsentwined/vim-emblem](https://github.com/heartsentwined/vim-emblem)"},{title:"Textmate 1.x",shell:"\n      cd ~/Library/Application Support/TextMate/Bundles/\n      git clone git://github.com/slim-template/ruby-slim.tmbundle.git Ruby Slim.tmbundle\n      osascript -e 'tell app \"TextMate\" to reload bundles'\n    "},{title:"Textmate 2.x",shell:"\n      cd ~/Library/Application Support/TextMate/Managed/Bundles/\n      git clone git://github.com/slim-template/ruby-slim.tmbundle.git Ruby Slim.tmbundle\n    "},{title:"Vim users with Slim Syntax highlighting",shell:"\n      au BufNewFile,BufRead *.emblem set filetype=slim\n    "}]
